slides.\",\"containsNotCompleted\":\"@slideName contains not completed interaction\",\"containsCompleted\":\"@slideName contains completed interaction\",\"slideCount\":\"Slide @index of @total\",\"containsOnlyCorrect\":\"@slideName only has correct answers\",\"containsIncorrectAnswers\":\"@slideName has incorrect answers\",\"shareResult\":\"Share Result\",\"accessibilityTotalScore\":\"You got @score of @maxScore points in total\",\"accessibilityEnteredFullscreen\":\"Entered fullscreen\",\"accessibilityExitedFullscreen\":\"Exited fullscreen\",\"accessibilityProgressBarLabel\":\"Choose slide to display\",\"confirmDialogHeader\":\"Submit your answers\",\"confirmDialogText\":\"This will submit your results, do you want to continue?\",\"confirmDialogConfirmText\":\"Submit and see results\",\"slideshowNavigationLabel\":\"Slideshow navigation\"}},\"metadata\":{\"title\":\"The Bird&#039;s Nest\",\"license\":\"U\",\"defaultLanguage\":\"en\",\"contentType\":\"Course Presentation\",\"authors\":[],\"changes\":[],\"extraTitle\":\"The Bird&#039;s Nest\"},\"subContentId\":\"8ec60ca1-5670-4abd-9265-af0f28bf363c\"},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"text\":\"<p>1. What are earthworms?</p>\\n\\n<p><span style=\\\"color:#0086ff\\\">Earthworms are invertebrates.</span></p>\\n\\n<p>2. How can you describe their bodies?</p>\\n\\n<p><span style=\\\"color:#0086ff\\\">Their bodies are soft. They don't have a shell nor an exoskeleton.</span></p>\\n\\n<p>3. Why are they easy to catch?</p>\\n\\n<p><span style=\\\"color:#0086ff\\\">Earthworms are easy to catch because they move slowly.</span></p>\\n\\n<p>4. Are worms only useful for birds to feed on? Do they play a role in nature? (Refer to slide 2)</p>\\n\\n<p><span style=\\\"color:#0086ff\\\">Earthworms contribute to soil health. They dig the soil and create tunnels as they move. These tunnels provide channels for air and water to penetrate the soil. This allows the roots of plants to access oxygen and nutrients more easily.</span></p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]},\"subContentId\":\"ecfa6221-eba4-4b20-8374-ca25879003c6\"},\"useSeparator\":\"disabled\"}]}","library":"H5P.Column 1.16","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"Earthworms... What are they good for?","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.Transition-1.0/transition.js?version=1.0.4","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-help-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-message-dialog.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progress-circle.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-simple-rounded-button.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-speech-bubble.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-throbber.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-tip.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-slider.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-score-bar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-progressbar.js?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/js/joubel-ui.js?version=1.3.19","/h5p/libraries/H5P.CoursePresentation-1.25/dist/h5p-course-presentation.js?version=1.25.9","/h5p/libraries/H5P.Image-1.1/image.js?version=1.1.22","/h5p/libraries/H5P.AdvancedText-1.1/text.js?version=1.1.14","/h5p/libraries/H5P.Column-1.16/scripts/h5p-column.js?version=1.16.5"],"styles":["/h5p/libraries/FontAwesome-4.5/h5p-font-awesome.min.css?version=4.5.4","/h5p/libraries/H5P.FontIcons-1.0/styles/h5p-font-icons.css?version=1.0.6","/h5p/libraries/H5P.JoubelUI-1.3/css/joubel-help-dialog.css?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3/css/joubel-message-dialog.css?version=1.3.19","/h5p/libraries/H5P.JoubelUI-1.3
